export type GptSchemaBase = Record<string, {
    action: string;
    display: {
        name: string;
        entry: (entry: Record<string, string>) => string | undefined;
    };
    description: string;
    values: string[];
}>;
export type GptResult<T extends GptSchemaBase> = {
    -readonly [Key in keyof T]: {
        [ValueKey in T[Key]['values'][number]]: string;
    }[];
};
